exports.checkauth = (redirect1, redirect2) => {
  const token = localStorage.getItem("token");
  const usertype = localStorage.getItem("usertype");
  if (token == undefined || token == null || usertype === "Corporate") {
    this.setState({
      redirect: redirect1,
    });
  } else {
    this.setState({
      redirect: redirect2,
    });
  }
};
